const Home = () => {
    return (
        <>
        <Hero>
          <Banner title="luxurious homes" subtitle="Find your dream home today">
              <Link to='/rooms' className="btn-primary">
                  Listings
              </Link>
              </Banner>  
        </Hero>
        {/* <Servives /> */}
        {/* <FeaturedRooms rooms="rooms"/> */}

        </>
    );
}

export default Home
